import React from 'react';
import s from './PageLogin.module.css';

const PageLogin = () => {
    return <form className={s.auth}> 
            <input type='text' name={s.login} placeholder='логин' validations={{minLength: 5}} validationErrors={{minLength: 'Enter at least 5 sumbols'}} required/>
            <input type='password' name='password' placeholder='пароль' />
            <button>Вход</button>
        </form>
}

export default PageLogin;
